import React from 'react'
import PropTypes from 'prop-types'
class NavLinkBar extends React.Component {
  static propTypes = {
    data: PropTypes.array.isRequired
  }
  render() {
    const navList = this.props.data.filter(v => !v.hide)
    return (
      <div>底部组件</div>
    )
  }
}
export default NavLinkBar
